import React from 'react';
import logo from './public/praiseOutreachlogo.png';
import './App.css';
import Home from './pages/Home';
import Navbar from './jscomponents/Navbar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="praiseOutreachlogo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;

